import React from 'react'
import Navbar from './Navbar'
import Header from './Header'
import Particles from 'react-particles-js'
import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles({
    particlesCanva: {
        position: 'absolute',
    }
})

const Home = () => {
    const classes = useStyles();
    return (
        <>
            <Navbar />
            <Header />
            <Particles
                canvasClassName={classes.particlesCanva}
                params={{
                    "fps_limit": 28,
                    "particles": {
                        "collisions": {
                            "enable": false
                        },
                        "number": {
                            "value": 500,
                            "density": {
                                "enable": false
                            }
                        },
                        "line_linked": {
                            "enable": true,
                            "distance": 30,
                            "opacity": 0.4
                        },
                        "move": {
                            "speed": 1
                        },
                        "opacity": {
                            "anim": {
                                "enable": true,
                                "opacity_min": 0.05,
                                "speed": 1,
                                "sync": false
                            },
                            "value": 0.4
                        }
                    },
                }}
            />
        </>
    )
}

export default Home;
